import React from 'react';
import {Grid,Card, CardContent, Typography, Paper} from '@material-ui/core';

const Index=()=>{
return(
    <Grid container direction="row" justify="center" alignItems="center">
        <Grid item xs={12}>
        <Paper>
            <CardContent>
                <Typography>
                    Log In/Out
                </Typography>
            </CardContent>
        </Paper>
        </Grid>
    </Grid>
);
}
export default Index;
